import React, { useContext } from "react";
import { CountdownCircleTimer } from "react-countdown-circle-timer";
import RenderTime from "./RenderTime";
import { Context, SelectReset } from "./SelectReset";

function App() {
  const reset = useContext(Context);

  if (reset.reset) {
    alert("hi");
  }

  return (
    <div className="App">
      <h1>
        <a
          href="https://www.reactlabs.ai/"
          target="_blank"
          rel="noopener noreferrer"
        >
          React Labs
        </a>
        <br />
        ReactJS Assignment
      </h1>
      <div className="timer-wrapper">
        <CountdownCircleTimer
          isPlaying
          duration={10}
          colors={[
            ["#00ff0f", 0.33],
            ["#cdca10", 0.33],
            ["#ff0000", 0.33],
          ]}
        >
          <RenderTime />
        </CountdownCircleTimer>
        <SelectReset />
      </div>
    </div>
  );
}

export default App;
